import styled from "styled-components";

export const AddUserDiv = styled.div`
  transition: all 0.1s;
  width: 100%;
  height: 100%;
  border-radius: 4px;
  background-color: white;
  margin-top: 5em;
  padding: 2em;
  box-sizing: border-box;
  position: fixed;
  z-index: 5;
`;
